          <th> Action </th>
        </thead>
        <tbody>
          <tr>
            <td><img src="data:image/jpeg;base64,"></td>
            <td> 1 </td>
            <td> Bootstrap </td>
            <td class="address"> 5 people </td>
            <td> 1 </td>
            <td>
              <a href="/admin/edit"> Edit </a>
              <a href="/admin/delete"> Delete </a>
            </td>
          </tr>
          <tr>
            <td><img src="data:image/jpeg;base64,"></td>
            <td> 2 </td>
            <td> Minion Work (basics) </td>
            <td class="address"> 100 people </td>
            <td> 22 </td>
            <td>
              <a href="/admin/edit"> Edit </a>
